description:
Canada's Worst Driver 6 is the sixth season of the Canada's Worst Driver series, where eight contestants known by those close to them for being bad drivers are taught lessons on improving their driving skills. As with previous seasons, the contestants are taken to the Driver Rehabilitation Centre, which takes place this year at Dunnville Airport in Dunnville, Ontario.
